import React from 'react';
import classes from './TaskList.module.css';

const TaskRender = (props) => {
  return (
    <li className={classes.task} key={props.id}>
      <h2>{props.title}</h2>
      <h3>{props.date}</h3>
    </li>
  );
};

export default TaskRender;
